KING'S BENCH MASTERS COST MANAGEMENT HEARINGS GUIDANCE NOTE

This Note has been prepared to assist parties in advance of cost management hearings in the King's Bench Division involving high value personal injury and clinical negligence claims. Its purpose is to facilitate a neutral approach to issues which commonly arise in the budgeting process with a view to promoting timely settlement of those issues.
General approach

1. A costs budget is not reached through the same process as detailed assessment. However, in considering whether a budget is proportionate the court required to have regard to the provisions of CPR 44.3 (5). This provides:

Costs incurred are proportionate if they bear a reasonable relationship to -
(a) the sums in issue in the proceedings;
(b) the value of any non-monetary relief in issue in the proceedings;
(c) the complexity of the litigation;
(d) any additional work generated by the conduct of the paying party,
(e) any wider factors involved in the proceedings, such as reputation or public importance; and
(f) any additional work undertaken or expense incurred due to the vulnerability of a party or any witness.
2. In considering whether costs are reasonable the following factors which are set out at CPR 44.4 (2) are relevant to the amount of a costs budget:
(a) the amount or value of any money or property involved;
(b) the particular complexity of the matter or the difficulty or novelty of the questions raised;
(c) the skill, effort, specialised knowledge and responsibility involved;
(d) the place where and the circumstances in which work or any part of it is to be done.
